import React from 'react';
import { BrowserRouter } from 'react-router-dom';
import AppRouter from './components/AppRouter';
import NavBar from './components/NavBar';

const App = observer(() => {

  return (
    <BrowserRouter>
    <NavBar/>
      <AppRouter/>
    </BrowserRouter>
  );
})

export default App;
